import React, { useEffect, useState } from 'react';
import CardComp from './CardComp';
import Item from './Item';

const Home = () => {
  const objectModel = { node: { content: { title: '' } } };
  const createExampleArray = (model, repeatAmount) => {
    console.log('executed');
    let array = [];

    for (let i = 0; i > repeatAmount; i++) {
      console.log('array');
      array.push(model);
      return array;
    }
  };
  const [data, setData] = useState(createExampleArray(objectModel, 100));
  useEffect(() => {
    console.log(data);
    fetch('http://localhost:5000/buscar?plt=hbm&gnr=act,cmy')
      .then((res) => res.json())
      .then((res) => console.log('data: ', res))
      .then((res) => setData(res));
  }, []);

  return (
    <div className="home">
      {[1, 2, 3, 4, 5].map((i) => {
        return (
          <Item key={i} texto="texto">
            {[1, 2, 3, 4, 5, 6, 7, 8, 9].map((i) => {
              return (
                <CardComp
                  key={i}
                  cardText="Descripcion"
                  cardTitle="holiwis"
                  cardSubTitle="Subtitulo"
                  cardImg="https://placedog.net/300/250"
                ></CardComp>
              );
            })}
          </Item>
        );
      })}
    </div>
  );
};

export { Home };
